import React from 'react'
import Dashboard from '../Dashboard'
import {Link} from 'react-router-dom'
import {Button} from 'react-bootstrap'
import styled from 'styled-components'

export default function IndivCrew() {
    return (
        <>
            <Dashboard/>
            <div>
                <Image>
                    <img style={{width: "250px", height: "300px"}} src="https://m.media-amazon.com/images/M/MV5BMTQzMzg1ODAyNl5BMl5BanBnXkFtZTYwMjAxODQ1._V1_SX150_CR0,0,150,150_.jpg" alt=""/>
                </Image>
                <Email><h2>randomr@email.com</h2></Email>
                <ChangeBtn><Button>Change Password</Button></ChangeBtn>
                <Box1>
                    <Title>
                        <h3>Pesonal Information </h3>
                    </Title>
                    <Text>
                        <h6>Age: 20</h6>
                        <h6>Gender: M</h6>
                    </Text>
                    <EditLink><Link>Edit Information</Link></EditLink>
                </Box1>
                <Box2>
                    <Title>
                        <h3>Languages</h3>
                    </Title>
                    <Text>
                        <h6>English</h6>
                        <h6>French</h6>
                    </Text>
                    <EditLink><Link>Edit Languages</Link></EditLink>
                </Box2>
            </div>

        </>
    )
}

const Header = styled.div`
    margin-left: 240px; 
    margin-top: 10px;
`
const Image = styled.div` 
    margin-left: 270px; 
    margin-top: 50px;
`

const Email = styled.div `
    margin-left: 680px; 
    margin-top: 10px;
`
const ChangeBtn = styled.div `
    margin-left: 1000px; 
    margin-top: 20px;
`

/**Build a Recipe App With React | React Tutorial For Beginners https://www.youtube.com/watch?v=U9T6YkEDkMo&list=PLDyQo7g0_nsVHmyZZpVJyFn5ojlboVEhE&index=2 */
const Box1 = styled.div`
    margin-top: 50px; 
    border-radius: 10px;
    box-shadow: 0px 12px 18px -6px rgba(0, 0, 0, 0.3);  
    margin-left: 400px; 
    background: white;
    height: 120px; 
    width: 800px; 
`

const Box2 = styled.div`
    margin-top: 50px; 
    border-radius: 10px;
    box-shadow: 0px 12px 18px -6px rgba(0, 0, 0, 0.3);  
    margin-left: 400px; 
    background: white;
    min-height: 120px; 
    width: 800px; 
`

/**Build a Recipe App With React | React Tutorial For Beginners https://www.youtube.com/watch?v=U9T6YkEDkMo&list=PLDyQo7g0_nsVHmyZZpVJyFn5ojlboVEhE&index=2 */

const Title = styled.div `
    margin-top: 30px;
    margin-left: 20px;
`
const Text = styled.div`
    margin-top: 20px;
    margin-left: 40px;
`
const EditLink = styled(Link) `
    margin-left: 650px; 
`
